import HeaderLogin from '../Header/HeaderLogin'

export default function HeaderComponent(props) {
    const [userLoggodenIn, setUser] = useState(props.userLoggedIn);
    return (
        <div className='header'>
            <div className="header-grid header-grid--left">
                {!userLoggodenIn ? "" : 
                <div>
                    <a style={"float:left"}>Isardo</a>
                    <ul className="navbar">
                        <li><a>Students</a></li>
                        <li><a>Lessons</a></li>
                    </ul>
                </div>}
                </div>
            <div className="header-grid header-grid--right">
                {!userLoggodenIn ? <HeaderLogin/> : "kupsmenu"}
            </div>
        </div>
    )
}
